import Expenses from "./components/Expenses";

const App = () => {

  const dbentries = [
    {
      id: 'e1',
      title: 'Chilean Pine',
      amount: 390.25,
      timepoint: new Date(2022, 7, 14),
    },
    {
      id: 'e2',
      title: 'Hearse Limo',
      amount: 295.35,
      timepoint: new Date(2021, 2, 12)
    },
    {
      id: 'e3',
      title: 'Oak Coffin',
      amount: 850.65,
      timepoint: new Date(2022, 2, 28),
    },
    {
      id: 'e4',
      title: 'Iron Spade',
      amount: 650.55,
      timepoint: new Date(2023, 5, 12),
    },
  ];

  return (
    <div className="content">
      <h1 className="heading-primary">Exciting Funeral Expenses</h1>
      <Expenses expenseitem={dbentries} />
    </div>
  );
}

export default App;
